export class Player {

    constructor(name) {
        this._name = name;
        this._score = 0;
        this._position = 1;
    }

    get name() {
        return this._name;
    }

    get score() {
        return this._score;
    }

    get position() {
        return this._position;
    }

    set score(newScore) {
        this._score = newScore;
    }

    set position(newPosition) {
        this._position = newPosition;
    }

    incrementScore() {
        this._score = 1;
        this._score++;
    }
}
